INSERT INTO `product_details` (`product_id`, `product_name`, `brand_name`, `product_price`, `product_image`, `product_quantity`, `product_status`, `description`, `effects`, `working`, `subcategory_id`, `discount`) VALUES
(1, 'Acamprol 333mg 6 Tablet ', '', 60, '1.jpg', 99, 0, 'Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Acamptas 333 Tablet is to be taken with food.', '1) Diarrhea\r\n\r\n2) Abdominal pain\r\n\r\n3) Nausea', 'Acamptas 333 Tablet blocks the chemical which breaks the converted form of alcohol in the body. This leads to an increased level of converted form of alcohol in the body causing bad physical features while drinking alcohol.', 1, ''),
(2, 'Acamptas 333mg 6 Tablet ', '', 50, '2.webp', 88, 1, 'Acamptas 333 Tablet is used along with counseling and social support to help patients who are dependent on alcohol to abstain from drinking alcoholic drinks. However, it does not prevent the withdrawal symptoms that patients may experience when alcohol consumption is stopped. It is also not effective if the consumption of alcohol or other substances of abuse is continued. This medicine is not recommended for use in patients less than 18 years of age.', '1 . Fall in blood pressure\r\n2 . Nausea and Vomiting\r\nConstipation', 'This medicine works by stabilizing the chemical balance in the brain that would otherwise be disrupted by consumption of large quantities of alcohol for an extended duration.', 1, ''),
(3, 'Acutrol C 400mg 10 Tablet', '', 70, '3.webp', 86, 1, 'Acutrol-C 400 MG Tablet is used to lower the elevated phosphate levels in the blood by preventing its absorption in the intestine. It is used in severe kidney disease patients. Do not take this medicine if you have any gastrointestinal diseases.', '1 . Abdominal pain\r\n2 . Nausea and Vomiting\r\n3 . Constipation\r\n4 . Bloating\r\n5 . Excessive air or gas in stomach', 'It works by preventing the absorption of phosphorous in your diet into the intestine.', 1, ''),
(4, 'Alcoliv 500mg 10 Tablet', '', 90, '4.webp', 98, 1, 'Alcoliv Tablet is a liver-protective agent used in the treatment of alcohol intoxication and fatty liver.', '1 . Dizziness\r\n2 . Itching of skin\r\n3 . Restlessness\r\n4 . Shaking of the hands or feet', 'It accelerates the elimination of alcohol from the body and reduces the toxic effects of alcohol.', 1, ''),
(5, 'Desirox 500mg 30 Tablet', '', 30, '5.jpg', 95, 1, 'Desirox-500 Tablet is used to treat an excessive accumulation of iron in the body due to multiple blood transfusions; it is used in adults and children above 2 years of age. It is also used for removing an excess of iron in the body that may be caused by a genetic disorder known as non-transfusion-dependent thalassemia (NTDT); it is used in adults and children above 10 years of age.', '1 . Nausea and vomiting\r\n2 . Dizziness\r\nEarache\r\n3 .  Stomach pain', 'This medicine combines with the iron in the body and the complex thus formed in excreted in the urine.', 1, ''),
(6, 'Disulfiram 250mg 10 Tablet', '', 60, '6.jpg', 100, 1, NULL, NULL, NULL, 1, ''),
(7, 'Esperal 10 Tablet', '', 55, '7.jpg', 100, 1, NULL, NULL, NULL, 1, ''),
(8, 'Fosend 500mg 10 Tablet', '', 40, '8.jpg', 80, 1, NULL, NULL, NULL, 1, ''),
(9, 'Livodox Tablets', '', 48, '9.jpg', 13, 1, NULL, NULL, NULL, 1, ''),
(10, 'Naltima 50mg Tablet', '', 88, '10.webp', 100, 1, NULL, NULL, NULL, 1, ''),
(16, 'Pampers New Pants Monthly Box', 'Patanjali', 50, '16.webp', 98, 1, ' Repeated use of cloth and water can erode your baby\'s skin\'s natural protective layer. That\'s why Johnson\'s Baby Skincare Wipes are specially designed using innovative water-saturated fibre which packs 3 times the weight of moisturizing lotion, to keep your baby\'s skin soft. Each wipe is enriched with moisturizing ingredients that help protect against redness and rash. Johnson\'s Baby Skincare Wipes, as mild to the skin as pure water, provide soft and gentle care for delicate newborn skin.', 'For external use only. Keep out of reach of children. Discontinue use if skin irritation occurs', 'Wet Wipes for Soft and gentle care for newborn,helps to protect against redness and rash-Enriched with 3X weight of moisturizing lotion-Clinically proven mild and gentle-Allergy tested; Dermatologist tested-Every Johnson’s product passes a 5 level safety assurance process.', 6, '25'),
(17, 'Himalaya Anti Dandruff Shampoo 400 Ml', 'Himalaya', 30, '17.jpg', 100, 1, 'Say goodbye to dry and itchy scalp with Himalaya Anti Dandruff Shampoo. The anti-fungal property of Tea Tree Oil effectively treats dandruff while Aloe Vera softens hair and soothes the scalp, helping to alleviate itching. It also stimulates hair follicle growth and control hair fall.\r\n\r\nEffective for all hair types. Safe to use on artificially colored or permed hair.', 'Helps prevent hair damage\r\nNourishes hair\r\nRemoves dirt from the scalp\r\nImproves the texture of the hair', 'Gently massage the shampoo into wet hair and scalp. Leave for two to three minutes, and rinse thoroughly. Repeat if necessary.', 6, '35'),
(18, 'Johnsons Active Kids Soft & Smooth Shampoo 200 ml', 'Johnsons', 47, '18.webp', 100, 1, 'Johnson’s understands that as your child grows, their hair also changes and needs its very own special care. That’s why this mild soft & smooth shampoo formula has been developed to boost natural shine and help reduce frizz, leaving hair silky, smooth and healthy looking', 'For external use only. Keep out of reach of children. Discontinue use if skin irritation occurs', 'Apply on wet hair, gently lather,rinse.', 6, '15'),
(19, 'Womens Horlicks - Chocolate Flavour 400 gm', 'Patanjali', 90, '19.jpg', 65, 0, '1 . Keeps the women stronger\r\n\r\n2 . Provides stamina\r\n\r\n3 . Calcium makes the skeletal system stronger\r\n\r\n4 . Contains vitamins and minerals to improve overall better health\r\n\r\n\r\n\r\nBuilds immunity', NULL, NULL, 6, '10'),
(20, 'Nestle Baby Powder 400 gm ', 'Nestle', 70, '20.jpg', 97, 1, 'With a delicious vanilla flavour, it provides the balanced formulation of macro and micronutrients\r\nReconstitution is recommended with milk to build on and also help mask the taste and aroma of milk which is a problem for most pregnant women\r\nNestle Baby & Me is a pregnancy nutritional supplement for pregnant women as well as lactating mothers till the time of breastfeeding', NULL, NULL, 6, '5'),
(21, 'Nestle Cerelac - Wheat Apple', 'Nestle', 35, '21.jpg', 88, 1, 'With a delicious vanilla flavour, it provides the balanced formulation of macro and micronutrients\r\nReconstitution is recommended with milk to build on and also help mask the taste and aroma of milk which is a problem for most pregnant women\r\nNestle Baby & Me is a pregnancy nutritional supplement for pregnant women as well as lactating mothers till the time of breastfeeding', NULL, NULL, 6, '7'),
(22, 'Bioderma Photoderm - Light Shade 40 ml', 'Abbott', 80, '22.webp', 80, 1, 'Silky Smooth Skin, for up to 7 days, is now just a shower-away\r\nSmoothness that lasts 2 times longer than shaving\r\nHydrated skin for up to 24 hours\r\nWorks in 5-10 minutes, comes with a easy applicator sponge\r\nEnriched with Aloe Vera and Violet blossom extract', NULL, NULL, 8, '10'),
(23, 'Baksons Sun Care Cream 100 gm', 'Abbott', 90, '23.webp', 50, 1, 'Silky Smooth Skin, for up to 7 days, is now just a shower-away\r\nSmoothness that lasts 2 times longer than shaving\r\nHydrated skin for up to 24 hours\r\nWorks in 5-10 minutes, comes with a easy applicator sponge\r\nEnriched with Aloe Vera and Violet blossom extract', NULL, NULL, 8, '15'),
(24, 'Aderma Exomega Cream 50 ml', 'Johnsons', 40, '24.jpg', 97, 1, 'Refresh your senses with the revitalizing scent of lemon, while the silky fresh gel with pampering oil pearls lathers into caring, soft foam – for the unique sensation of fresh, well-cared for skin\r\nRelax and rejuvenate with every shower\r\nWith Hydra IQ 24h+ moisture technology for a soft skin feeling', NULL, NULL, 8, '20'),
(25, 'Baksons Chrysarobinum Ointment 25 gm', 'Himalaya', 50, '25.jpg', 85, 1, 'Refresh your senses with the revitalizing scent of lemon, while the silky fresh gel with pampering oil pearls lathers into caring, soft foam – for the unique sensation of fresh, well-cared for skin\r\nRelax and rejuvenate with every shower\r\nWith Hydra IQ 24h+ moisture technology for a soft skin feeling', NULL, NULL, 8, '15'),
(26, 'Veet Hair Removal Cream - Sensitive 50 gm', 'Dexolac', 45, '26.webp', 75, 1, 'Silky Smooth Skin, for up to 7 days, is now just a shower-away\r\nSmoothness that lasts 2 times longer than shaving\r\nHydrated skin for up to 24 hours\r\nWorks in 5-10 minutes, comes with a easy applicator sponge\r\nEnriched with Aloe Vera and Violet blossom extract', NULL, NULL, 7, '10'),
(27, 'Dettol Soap - Skincare with Moisturizers 75 gm', 'Himalaya', 90, '27.jpg', 70, 1, 'Dettol\'s trusted germ protection enriched with moisturizers to give you healthy, nourished and soft skin\r\nDettol bar soaps provide 100 percent better protection compared to ordinary soaps\r\nRecommended by Indian medical association dermatologically tested', NULL, NULL, 7, '15'),
(28, 'Himalaya Cucumber & Coconut Soap 75 gm', 'Himalaya', 70, '28.jpg', 50, 1, 'Dettol\'s trusted germ protection enriched with moisturizers to give you healthy, nourished and soft skin\r\nDettol bar soaps provide 100 percent better protection compared to ordinary soaps\r\nRecommended by Indian medical association dermatologically tested', NULL, NULL, 7, '10'),
(29, 'Nivea Lemon & Oil Shower Gel 250 ml', 'Nivea', 40, '29.jpg', 75, 1, 'Refresh your senses with the revitalizing scent of lemon, while the silky fresh gel with pampering oil pearls lathers into caring, soft foam – for the unique sensation of fresh, well-cared for skin\r\nRelax and rejuvenate with every shower\r\nWith Hydra IQ 24h+ moisture technology for a soft skin feeling', NULL, NULL, 7, '20'),
(30, 'Sensodyne Fresh Mint Toothpaste 150 gm', 'Sensodyne', 35, '30.jpg', 45, 1, 'Clinically proven relief and daily protection for sensitive teeth. Relieves sensitivity by building a protective barrier that blocks the sensitivity caused by hot, cold, sweet and other contact triggers. Contains fluoride to prevent cavities so that you can use it every day. Toothpaste has a cool refreshing taste that leaves your mouth feeling fresh and clean.\r\n', NULL, NULL, 9, '10'),
(31, 'Sensodyne Sensitive Soft Toothbrush', 'Sensodyne', 25, '31.jpg', 80, 1, 'Specially designed for people with sensitive teeth. Provides effective cleaning of the teeth. Broad ergonomic handle ensures comfortable grip and better reach\r\n', NULL, NULL, 9, '5'),
(32, 'Colgate Plax Mouthwash - Fresh Tea 250 ml', 'Patanjali', 57, '32.webp', 60, 1, 'Removes over 99.9% of germs\r\nProtects against germ build up\r\nProvides up to 64% healthier gums\r\nHelps PREVENT CAVITIES\r\n12 hour protection against germs & plaque\r\nGives long lasting FRESH BREATH\r\nAlcohol-free\r\nNo burning sensation\r\nClinically tested by dentist', NULL, NULL, 9, '8');

